// ------------------------------ Start From End of this File --------------------
function Dashboard({ navigation }) {

    const [step,setStep]=React.useState(1);

 
  return (
    <View style={{ flex: 1}}>
{/* ------------------------------------- Header -------------------------------------  */}
      <View style={{flex:0.1,backgroundColor:'white',justifyContent:'center',alignItems:'center',flexDirection:'row'}}>
      <View style={{flex:0.2,marginStart:'2%'}}>
    <TouchableOpacity
        onPress={()=>{
            navigation.openDrawer()
        }}
    >
     <Text style={{fontSize:30,fontWeight:'bold',color:'#0f629d'}}>{'::'}</Text>
     </TouchableOpacity>
     </View >   
     <View style={{flex:0.8}}>
         
      <Text style={{color:'#0f629d',fontWeight:'bold',fontSize:30}}>Post-hire checklist</Text>
      </View> 
      </View>

{/*-------------------------------------  Body ---- Steps -------------------------------------  */}
      <View style={{backgroundColor:'grey',height:0.6,flexDirection:"row"}}></View>
      <View style={{flex:0.8,backgroundColor:'white',alignItems:'center'}}>
      {
          // -------------------------------------  Check Steps ------------------------------------- 
          step==1?<Step1></Step1>:step==2?<Step2></Step2>:step==3?<Step3></Step3>:
          step==4?<Step4></Step4>:step==5?<Step5></Step5>:<Step6></Step6>
      }
      </View>


      {/* Footer */}
      <View style={{flex:0.1,backgroundColor:'#0f629d',justifyContent:'space-around',flexDirection:'row'}}>
      
      <View style={{justifyContent:'center',alignItems:'flex-start',flex:0.5}}>
      {
          step!=1?<TouchableOpacity
          onPress={()=>{
              setStep(step-1);
          }}
          >
          <Text style={{color:'white',fontSize:20,marginStart:'5%'}} >{' <'} Back</Text>
          </TouchableOpacity>:<View/>
      }
      
      </View>
      <View style={{justifyContent:'center',alignItems:'flex-end',flex:0.5}}>

     
      <TouchableOpacity 
      onPress={()=>{
          setStep(step+1);
      }}>
      <Text style={{color:'white',fontSize:20,marginEnd:'5%'}} >Next {' >'} </Text>
      </TouchableOpacity>
      </View>
      </View>
    </View>
  );
}
